// ignore_for_file: unused_import
import 'dart:convert';
import 'dart:io';
import 'package:cloud_firestore/cloud_firestore.dart';
import 'package:flutter/material.dart';

class Volume implements Comparable<Volume> {
  static const String imageNotFoundB64 =
      '''''';
  final String uuid;
  final bool isVariant;
  final String mangaUUID;
  final int volumeNumber;
  final String imageB64;

  ///Default constructor
  const Volume({
    required this.uuid,
    required this.isVariant,
    required this.mangaUUID,
    required this.volumeNumber,
    this.imageB64 = imageNotFoundB64,
  });

  ///Firebase database volume constructor
  factory Volume.fromFirebase(
    DocumentSnapshot<Map<String, dynamic>> snapshot,
    SnapshotOptions? options,
  ) {
    final data = snapshot.data();
    return Volume(
      uuid: data?['volumeUUID'] ?? snapshot.id,
      isVariant: data?['volumeIsVariant'] ?? emptyVolume.isVariant,
      mangaUUID: data?['volumeMangaUUID'] ?? emptyVolume.mangaUUID,
      volumeNumber: data?['volumeNumber'] ?? emptyVolume.volumeNumber,
      imageB64: data?['volumeImageB64'] ?? emptyVolume.imageB64,
    );
  }

  /// Returns the volume corresponding to the given uuid or emptyVolume if not exist
  static Future<Volume> getVolumeByUUID(uuid) async {
    final db = FirebaseFirestore.instance;
    final res = await db
        .collection('volumes')
        .doc(uuid)
        .withConverter(
            fromFirestore: Volume.fromFirebase,
            toFirestore: (e, _) => e.toFirestore())
        .get();

    return res.exists ? res.data()! : emptyVolume;
  }

  /// Mapping volume
  Map<String, dynamic> toFirestore() {
    if (mangaUUID == emptyVolume.mangaUUID) {
      return {};
    }
    return {
      "volumeUUID": uuid,
      "volumeIsVariant": isVariant,
      "volumeMangaUUID": mangaUUID,
      "volumeNumber": volumeNumber,
      "volumeImageB64": imageB64,
    };
  }

  /// Volume a,b:
  /// <li> a == b <=> a.uuid == b.uuid
  /// <li> a < b <=> (a.mangaUUID == b.mangaUUID AND a.volumeNumber < b.volumeNumber) OR (a.mangaUUID == b.mangaUUID AND a.volumeNumber == b.volumeNumber AND NOT(a.isVariant) AND b.isVariant)
  /// <li> a > b <=> (a.mangaUUID == b.mangaUUID AND a.volumeNumber > b.volumeNumber) OR (a.mangaUUID == b.mangaUUID AND a.volumeNumber == b.volumeNumber AND a.isVariant AND NOT(b.isVariant))
  @override
  int compareTo(Volume other) {
    if (uuid == other.uuid) {
      return 0;
    }
    if (mangaUUID == other.mangaUUID) {
      if (volumeNumber == other.volumeNumber) {
        if (isVariant && !other.isVariant) {
          return 1;
        }
        if (!isVariant && other.isVariant) {
          return -1;
        }
        if (isVariant == other.isVariant) {
          return 0;
        }
      } else if (volumeNumber < other.volumeNumber) {
        return -1;
      } else {
        return 1;
      }
    }
    if (mangaUUID != other.mangaUUID) {
      throw UnsupportedError("Comparing volumes from different mangas");
    }
    throw "Comparator Error: function finished without returning";
  }

  @override
  String toString() {
    return """{'uuid': $uuid,
    'volumeMangaUUID': $mangaUUID,
    'volumeNumber': $volumeNumber,
    'volumeIsVariant': $isVariant},
    'volumeImageB64': ${imageB64.substring(30, 70)}""";
  }

  /// Returns the Image cover of the volume
  Image getVolumeImage({
    Key? key,
    double scale = 1.0,
    Widget Function(BuildContext, Widget, int?, bool)? frameBuilder,
    Widget Function(BuildContext, Object, StackTrace?)? errorBuilder,
    String? semanticLabel,
    bool excludeFromSemantics = false,
    double? width,
    double? height,
    Color? color,
    Animation<double>? opacity,
    BlendMode? colorBlendMode,
    BoxFit? fit,
    AlignmentGeometry alignment = Alignment.center,
    ImageRepeat repeat = ImageRepeat.noRepeat,
    Rect? centerSlice,
    bool matchTextDirection = false,
    bool gaplessPlayback = false,
    bool isAntiAlias = false,
    FilterQuality filterQuality = FilterQuality.low,
    int? cacheWidth,
    int? cacheHeight,
  }) {
    return Image.memory(
      base64Decode(imageB64),
      key: key,
      scale: scale,
      frameBuilder: frameBuilder,
      errorBuilder: errorBuilder,
      semanticLabel: semanticLabel,
      excludeFromSemantics: excludeFromSemantics,
      width: width,
      height: height,
      color: color,
      opacity: opacity,
      colorBlendMode: colorBlendMode,
      fit: fit,
      alignment: alignment,
      repeat: repeat,
      centerSlice: centerSlice,
      matchTextDirection: matchTextDirection,
      gaplessPlayback: gaplessPlayback,
      isAntiAlias: isAntiAlias,
      filterQuality: filterQuality,
      cacheHeight: cacheHeight,
      cacheWidth: cacheWidth,
    );
  }

  /// Wraps the volume image inside a box shadow with tap detection
  /// <li> action -> the function to call on tap
  /// <li> argv -> the arguments to give to action
  Widget volumeImageWrapper({
    required BuildContext context,
    Function action = print,
    List<dynamic> argv = const <String>[],
  }) {
    return GestureDetector(
      onTap: () => action(argv),
      child: Container(
        decoration: BoxDecoration(
          boxShadow: [
            BoxShadow(
              color: Colors.grey.withOpacity(0.2),
              spreadRadius: 1.5,
              blurRadius: 3,
              offset: const Offset(0, 1),
            )
          ],
        ),
        alignment: Alignment.center,
        child: ClipRRect(
            borderRadius: BorderRadius.circular(4.0), child: getVolumeImage()),
      ),
    );
  }

  /// Show the popup dialog to add/remove volume from the library
  /// <li> argv[0] -> context
  /// <li> argv[1] -> actionTitle
  /// <li> argv[2] -> action
  Future<void> showVolume(List<dynamic> argv) async {
    switch (await showDialog<String>(
        context: argv[0],
        builder: (BuildContext context) {
          return SimpleDialog(
            children: <Widget>[
              Container(
                  padding: const EdgeInsets.all(6.0), child: getVolumeImage()),
              const Divider(),
              SimpleDialogOption(
                onPressed: () {
                  Navigator.pop(context, 'action');
                },
                child: Text(argv[1]),
              ),
            ],
          );
        })) {
      case 'action':
        argv[2]();
        break;
      case null:
        break;
    }
  }
}

///Default empty volume in case of errors
const Volume emptyVolume = Volume(
  uuid: "VolumeNotFound",
  isVariant: false,
  mangaUUID: "MangaNotFound",
  volumeNumber: -1,
  imageB64: Volume.imageNotFoundB64,
);
